async (textContent: string) => {
  const parsedDialogue = parseDialogue(textContent);

  console.log({ parsedDialogue });
  const sentencesWithUuid = await oneByOne(parsedDialogue, async (sentence) => {
    if (sentence.voice === "Morty") {
      return {
        ...sentence,
        uuid: uberduckSpeak("morty", sentence.sentence),
      };
    }
    return {
      ...sentence,
      uuid: uberduckSpeak("rick-sanchez", sentence.sentence),
    };
  });

  console.log({ sentencesWithUuid });
  return sentencesWithUuid;
}
